# Country code lookup using offline quadtree generated by Yggdrasil.
#
# This Ruby script can be used to determine the name of the country at a given
# WGS84 coordinate. Lookup is based on quadtree data stored in the remainder
# of this file. This data can be compressed to under 20 KB, while providing
# lookup accuracy under 40 km. The lookup is stored in the 'plain' format.
#
# Usage: ruby country.rb <latitude> <longitude>
# License: BSD
# Author:  Leonard van Driel, 2013
# See: https://github.com/leonardvandriel/Yggdrasil

# rubocop:disable Metrics/LineLength, Metrics/MethodLength, Metrics/AbcSize

require 'json'

# recursively traverse quad tree
def traverse(x, y, node, names, rect)
  return names[node] unless node.is_a?(Array)
  rect[:width] /= 2.0
  rect[:height] /= 2.0
  index = 0
  if x >= rect[:x] + rect[:width]
    index += 1
    rect[:x] += rect[:width]
  end
  if y >= rect[:y] + rect[:height]
    index += 2
    rect[:y] += rect[:height]
  end
  traverse(x, y, node[index], names, rect)
end

# recursively replace names with index and collect names
def collect(node, hash)
  node.is_a?(Array) ? node.map { |n| collect(n, hash) } : (hash[node] ||= hash.size)
end

# parse 'plain' formatted data into nested array tree
def parse(data)
  tree = JSON.parse(data.strip.gsub(/([^,\[\]]+)/, '"\\1"').gsub('[,', '[null,').gsub(',,', ',null,').gsub(',,', ',null,').gsub(',]', ',null]'))
  hash = { nil => 0 }
  [collect(tree, hash), hash.keys]
end

# find country name at latitude longitude
def label(lat, lng, tree)
  return 'none' unless lat >= -90 && lat <= 90 && lng >= -180 && lng <= 180 # && (lat != 0 || lng != 0)
  traverse(lng, lat, *tree, x: -180, y: -180, width: 360, height: 360) || 'ocean'
end

# main
def run
  if ARGV[0] == 'performance'
    run_performance((ARGV[1] || 5).to_i, parse(DATA.read))
  elsif ARGV.size == 2
    run_lookup(ARGV[0].to_f, ARGV[1].to_f, parse(DATA.read))
  else
    run_help(parse(DATA.read))
  end
end

def run_lookup(lat, lng, root)
  coord = "#{lat.abs} #{lat >= 0 ? 'N' : 'S'} #{lng.abs} #{lng >= 0 ? 'E' : 'W'}"
  puts "Country at #{coord} is " + label(lat, lng, root)
end

def run_performance(seconds, root)
  puts "Timing performance of random lookups (takes about #{seconds} seconds)"
  puts 'NB: this is an optimistic estimate, in practice lookups are performed on coorinates where the tree branches most.'
  start = Time.now
  duration = loops = 0
  loop do
    100_000.times { label(180 * rand - 90, 360 * rand - 180, root) }
    duration = Time.now - start
    loops += 1
    break unless duration < seconds
  end
  puts "#{loops * 100}_000 lookups were performed, #{(loops * 100 / duration).round}_000 per second, #{(duration / loops * 10_000).round} nano seconds each"
end

def run_help(root)
  puts 'usage: ruby country.rb <latitude> <longitude>'
  puts 'example output:'
  puts 'Country at 52N 5E is ' + label(52, 5, root)
  puts 'Country at 37N 122W is ' + label(37, -122, root)
end

run

